import { Posts } from '../utils/data'
import { Post } from './post'
import { Share } from './share'

export function Feed() {

    return (
        <div>
            <Share />
            {Posts.map((curr, i) => (
                <Post key={i} postItems={curr} />
            ))}
        </div>
    )
}
